description:
Space cats have landed on Earth &amp; find it is an awful mess! You are the brave pilot of a giant robot cat. Your job is to save nature by destroying all the dirty human cities. Once every 5126 years, the space cats arrive on Earth to renew our planet in this way.

Recommended for any Android phone with screen size of 320x480 pixels or larger.

The gameplay is simple to learn, yet challenging to master. Crush human civilization to earn eco points. If you destroy any nature you earn negative eco points.

- Detailed full-3d romping levels to explore &amp; destroy
- Unique challenges: stop oil spills &amp; crush human military response
- Meet new animal friends &amp; help them out as you advance through the game
- Extra unlockable bonus levels for &quot;good cats&quot;
- Final big boss fight!
- Can you survive to the end of time, to discover the secret of human madness?

